class TodoList extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="todoListMain">
                <div className="header">
                    <form onSubmit={this.addItem}>
                        <input placeholde="enter task">
                        </input>
                        <button type="submit">submit</button>
                    </form>
                </div>
            </div>
        );
    }
}

export default TodoList;
